import React from 'react'
import Navbar from '../components/Navbar'
import Footer from '../components/Footer'
import Banner from '../components/Banner'
import CarCard from '../components/CarCard'
import NavbarLoggedIn from '../components/NavbarLoggedin'
import FooterLoggedIn from '../components/FooterLoggedIn'
import { makeStyles } from '@material-ui/core/styles';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import { withStyles } from '@material-ui/core/styles';
import Select from '@material-ui/core/Select';
import InputLabel from '@material-ui/core/InputLabel';
import NativeSelect from '@material-ui/core/NativeSelect';

const OurModels = () => {

    var AuthNavbar = '';
    var AuthFooter = '';

if(localStorage.getItem('auth_token'))

{

    AuthNavbar = (
     <NavbarLoggedIn/>
                );

    AuthFooter = (
     <FooterLoggedIn/>
                );


} else {

  AuthNavbar = (
     <Navbar/>
                );

    AuthFooter = (
     <Footer/>
                );            

    
}
const useStyles = makeStyles((theme) => ({

  formControl: {
    margin: theme.spacing(5),
    minWidth: 200,
    padding: '0px',
    border: '1px solid 9c1a1a',
    background: 'transparent',
    color: 'white',
  },

  Label: {
  
  color: 'white'


  },

}));

const StyledMenuItem = withStyles((theme) => ({
  root: {
    '&$disabled': {
      color: 'black',
      background: 'black',
      
    },
    background: 'transparent',
    borderRadius: 3,
    border: 0,
    color: 'black',
    height: 50,
    padding: '0 20px',
   boxShadow: '0 3px 5px 2px rgba(255, 255, 255, .3)',
    margin: "20px 0px 0px 0px",
    fontSize: '20px',
    '&:focus': {
      backgroundColor: "#9c1a1a",
      '& .MuiListItemIcon-root, & .MuiListItemText-primary': {
        color: "black",
      },
    },
  },
  
}))(MenuItem);

const StyledSelect = withStyles((theme) => ({
  root: {
    background: '#1717176e',
    borderRadius: 3,
    border: 0,
    color: 'white',
    height: 'auto',
    padding: '20px',
    boxShadow: '0px 5px 8px #1717176e',
    margin: "auto",
    fontSize: '20px',
  },
  
}))(Select);















const classes = useStyles();
  const [value, setValue] = React.useState('');
  const [open, setOpen] = React.useState(false);

  const handleChange = (event) => {
    setValue(event.target.value);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleOpen = () => {
    setOpen(true);
  };







  return (
    <div>
      <div className="empty_space"></div>
      {AuthNavbar}
      <Banner title="Modelljeink" />

      <div className="filter_container">
        <form>



        <FormControl variant="outlined" className={classes.formControl}>
        <StyledSelect
          open={open}
          onClose={handleClose}
          onOpen={handleOpen}
          value={value}
          onChange={handleChange}
          displayEmpty
         
        >
          <StyledMenuItem value={''} disabled>Kategória</StyledMenuItem>
          <StyledMenuItem value={'Sedan'}>Sedan</StyledMenuItem>
          <StyledMenuItem value={'Kombi'}>Kombi</StyledMenuItem>
          <StyledMenuItem value={'Hibrid'}>Hibrid</StyledMenuItem>
          <StyledMenuItem value={'Furgon'}>Furgon</StyledMenuItem>
        
        </StyledSelect>
      </FormControl>




         </form>
      
      </div>


      <div className="car_card_container">
      <CarCard />
      <CarCard />
      <CarCard />
      </div>



      {AuthFooter}


    </div>
  )
}

export default OurModels
